import React from "react";
import styled from "styled-components";
import { InnerLayout } from "../../styles/layouts";

function Income() {
  return (
    <IncomeStyled>
      <InnerLayout>
        <h1>Income</h1>
        .income-content
      </InnerLayout>
    </IncomeStyled>
  );
}

const IncomeStyled = styled.div``;

export default Income;
